<TR><TD BGCOLOR=#FF66FF ALIGN=center><TABLE BGCOLOR=#ffffff WIDTH=100% CELLPADDING=5><tr><TD>

・フィリップスのエクストリームアルティノン フェストゥーン 30mm ルームランプ129416700KX1です。
<br>・純正バルブではなし得なかった蒼白光の輝きを車内に灯します。点灯イメージは上図をご参照ください。
<br>・120°の均一な配光を設定されており、光り方にムラがありません。
<br>・Festoon 30mmタイプ、色温度6700K、光束45lm。1パッケージにつき1個入りとなっています。
<br>・本製品は国産車専用デザインです。
<br>・車検対応＆メーカー3年保証付き。安心して長くお使いいただけます。
<BR>・こちらのシリーズには色温度10000Kの<B>1294110000X1</B>もあります。


</td></tr></table></td></tr></table>
</center><style type="text/css">
/*買い物かごに入れるボタン*/
#rakutenLimitedId_aroundCart input[value="買い物かごに入れる"]{
background: url("http://image.rakuten.co.jp/creer/cabinet/ivent/imgrc0063944220.jpg") left top no-repeat;
width:235px;
height:54px;
text-indent:100%;
white-space:nowrap;
overflow:hidden;
border: none;
padding:0;
margin-top:5px 0;
cursor:pointer;
}
#rakutenLimitedId_aroundCart tbody tr td input:hover{
alpha(opacity=8);
-moz-opacity:0.8;
opacity:0.8;
cursor:pointer;
}

/*個数入力(箱)*/
input#units {
border:solid #ccc 1px;
background:#fff!important;
width:35px;
height:35px;
cursor:auto;
padding:7px 7px 7px 3px;
margin-bottom:17px;
font-size:17px;
color:#000;
}

/* お気に入り商品差し替えタグ */
#rakutenLimitedId_aroundCart #serviceTableSml td.favorite {
padding-top: 5px;
}
#rakutenLimitedId_aroundCart div.bookmarkArea div.bkm {
width: 200px !important;
height:35px !important;
padding: 0px 0px 10px 0px !important;
}
#rakutenLimitedId_aroundCart div.bookmarkArea div.bkm a.addBkm {
width: 200px !important;
height:35px !important;
}
#rakutenLimitedId_aroundCart div.bookmarkArea div.bkm a.addBkm span.bkmStar {
display: inline-block !important;
width: 200px !important;
height:35px !important;
margin:0px 0px 10px 0px !important;
background: url("http://image.rakuten.co.jp/creer/cabinet/ivent/imgrc0063944233.jpg") no-repeat !important;
}

/* お気に入りショップ差し替えタグ */
div.bookmarkArea {
width: 200px !important;
}
#rakutenLimitedId_aroundCart div.shopBookmarkArea div.shopBkm {
width: 200px !important;
height:35px !important;
padding: 0px 0px !important;
padding-left: 0px !important;
}
#rakutenLimitedId_aroundCart div.shopBookmarkArea div.shopBkm a.addShopBkm span.shopBkmStar {
display: inline-block !important;
width: 200px !important;
height:35px !important;
margin-right: 0px !important;
background: url("http://image.rakuten.co.jp/creer/cabinet/ivent/imgrc0063944234.jpg") no-repeat !important;
}
</style>

